import React, { Component } from 'react'
import {withProductConsumer} from '../../contextAPI'
import {Link} from 'react-router-dom'
import Error from '../../pages/Error';
import Loading from '../Cart/LoadingCart'

function CheckoutList({context}){

    const {cart, cartLoading} = context;

    if(cartLoading)
        return <Loading></Loading>

    if(cart.length === 0)
        return <Error></Error>

    return(
        <div className="form-wrapper-cart">
                        <div className="form-container">
                            <div className="btns">
                                <Link to="/cart">
                                    <button className="btn-primary-red">Back to cart</button>
                                </Link>
                                <button className="btn-primary-green">buy now</button>
                            </div>
                        </div>
                    </div>
    )

}

export default withProductConsumer(CheckoutList)
